import ExpressItem from './Components/ExpenseItem';

function App() {
  const expenses = [
    { title: 'BEER', amount: 2000, date: new Date(2021, 5, 28) },
    { title: 'MILK', amount: 1999, date: new Date(2021, 5, 27) },
    { title: 'SODA', amount: 1998, date: new Date(2021, 5, 26) },
    { title: 'JUICE', amount: 1997, date: new Date(2021, 5, 25) },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      <ExpressItem title={expenses[0].title} amount={expenses[0].amount} />
      <ExpressItem title={expenses[1].title} />
      <ExpressItem />
      <ExpressItem />
    </div>
  );
}

export default App;
